@iraqjop السعودية العنود الأسمري أول إمرأة عربية تحصل على الشارة الدولية من قبل الاتحاد الدولي لكرة القدم من الفيفا متواجدة في بطولة كأس الخليج  البصرة 
وتم تكليف العنود من قبل اللجنة المنظمة لخليجي 25 لقيادة مباريات 
  وفقا لقائمة مكونة من 19 حكما سعوديا اعتمدها للعام 2023

